import React from 'react';
import './Explore.css';
import post1 from '../../images/pp1.jpg';

const Explore=()=> {

    let data = [
        {
            id: 1,
            img: post1
        },
        {
            id: 2,
            img: post1
        },
        {
            id: 3,
            img: post1
        },
        {
            id: 4,
            img: post1
        },
        {
            id: 5,
            img: post1
        },
    ]
  return (
    <div className='explore_container'>
        <div>
            {data.map((item, index) => {
                return(
                    <div className='explore_posts' key={index}>
                        <img src={item.img} width="300px"></img>
                    </div>
                )
            })}
        </div>
    </div>
  )
}

export default Explore
